import styled from 'styled-components';

export const Container = styled.div`
  width: 960px;
  margin: 35px auto 0;
  h2 {
    text-align: center;
    font-size: 36px;
  }
`;
export const Content = styled.div`
  margin-top: 45px;
  div {
    width: 380px;
  }
`;
